import React from 'react';
import './RecValue.css';

const RecValue = props => {
    function renderData() {
        return props.concepts.map(item =>
            <tr key={item.id}>
            
                
                
            <td>Ingredients: {item.name}</td>
            <td>Value: {item.value} </td>
            
            
            
            </tr>
            )
    }
        return (
            <div>{renderData()}</div>
            
        )
    }


export default RecValue;
